import React, { useState } from 'react';

const App=()=>{
    const [number,setNumber]=useState(0);
// let count=0;
    const incNumber=()=>{
        // count++;
        setNumber(number+1);
    }
    return(
        <>
<h1>{number}</h1>
<button onClick={incNumber}>Click me</button>
        </>
    )
}

export default App;
